import React from 'react'
import Nav from 'react-bootstrap/Nav';
import { Link } from "react-router-dom";
import "../index.css"

const InicioSecion = () => {
  return (

    <div className="bodyLogin">

       <div className="login">
        <div className="form">
        <h1>Marketplace</h1>
        <p>Bienvenido a marketplace</p>


      </div>
      </div>

      <Nav className="nav p-4 justify-content-end">
      <Link to="/Registro">Unete a market place</Link>
      </Nav>


    </div>

  )
}

export default InicioSecion
